function basicGarbage(p, x, y, w, h) {
  p.beginShape();
  var up = y + h / 2;
  var down = y - h / 2;
  var left = x + w / 2;
  var right = x - w / 2;
  p.eclipse(x, y, w, h);
  p.eclipse(x, up, w, h);
  p.eclipse(x, down, w, h);
  p.eclipse(left, y, w, h);
  p.eclipse(right, y, w, h);
  p.endShape();
}
